import React from 'react'
import Navbar from '../Navbar'

function Audi() {
  return (
    <div>
        <Navbar/>
        <div>
            <img style={{width:"100%",height:"700px"}} src="https://grandcarrentalv1.b-cdn.net/wp-content/uploads/2017/01/zaudia5-004-960x550.jpg" alt="" />
        </div>
    </div>
  )
}

export default Audi
